import React, { useState } from 'react';
import Navbar from './projet/Navbar/Navbar';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './projet/Home';
import Footer from './projet/Footer/Footer';
import LoginSingup from './projet/LoginSingup/LoginSingup';

import ProductsDog from './projet/ProductsDog';
import Cart from './projet/Cart/Cart.js'; // Importation du composant Cart
import './projet/Style.css';
import './projet/Cart/Cart.css';

import ProductsCat from './projet/ProductsCat.js';
function App() {
  // État global du panier
  const [cart, setCart] = useState([]);

  return (
    <Router>
      <Navbar cart={cart} />
      <div className="content">
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/login" element={<LoginSingup />} />
          <Route path="/ProductsCat" element={<ProductsCat cart={cart} setCart={setCart} />} />
          <Route path="/productsDog" element={<ProductsDog cart={cart} setCart={setCart} />} />
          <Route path="/cart" element={<Cart />} />
        </Routes>
      </div>
      <Footer />
    </Router>
  );
}

export default App;
